import React from 'react';



class App extends React.Component{

  constructor(props){
    super(props);
    this.state = {
      email : "",
      password : ""
    }

  }



  render(){
    return(
      <>

          <form>
            <input type = "text" value = {this.state.value} />

          </form>



      </>
    )
  }
}

export default App;
